import styles from './HotelList.module.css';
const HotelList = () => {
  const hotelData = [
    {
      name: 'Aparthotel Stare Miasto',
      city: 'Madrid',
      price: 120,
      rate: 8.9,
      type: 'Excellent',
      image_url: './images/hotel_1.webp',
    },
    {
      name: 'Comfort Suites Airport',
      city: 'Austin',
      price: 140,
      rate: 9.3,
      type: 'Exceptional',
      image_url: './images/hotel_2.jpg',
    },
    {
      name: 'Four Seasons Hotel',
      city: 'Lisbon',
      price: 99,
      rate: 8.8,
      type: 'Excellent',
      image_url: './images/hotel_3.jpg',
    },
    {
      name: 'Hilton Garden Inn',
      city: 'Berlin',
      price: 105,
      rate: 8.9,
      type: 'Excellent',
      image_url: './images/hotel_4.jpg',
    },
  ];
  const hotelList = hotelData.map((hotel) => {
    return (
      <div className={styles.hotel}>
        <img src={hotel.image_url} alt={`${hotel.name}'s photo`} />
        <div className={styles.name}>{hotel.name}</div>
        <div className={styles.city}>{hotel.city}</div>
        <div className={styles.price}>Starting from ${hotel.price}</div>
        <div className={styles.rate}>
          <p>
            <span>{hotel.rate}</span>
            {hotel.type}
          </p>
        </div>
      </div>
    );
  });
  return hotelList;
};
export default HotelList;
